import React from "react";

function App() {
  return (
    <div className="min-h-screen bg-white text-gray-800 font-[Poppins]">
      {/* Header */}
      <header className="flex items-center justify-between p-4 shadow-md bg-white">
        <div className="flex items-center space-x-2">
          <img src="./logo.png" alt="Ghar-ki-baat" className="h-10 w-auto" />
          <h1 className="text-xl font-bold text-teal-600">Ghar-ki-baat</h1>
        </div>
        <nav className="space-x-6 hidden md:flex">
          <a href="#" className="text-gray-700 hover:text-teal-600">Home</a>
          <a href="#" className="text-gray-700 hover:text-teal-600">About</a>
          <a href="#" className="text-gray-700 hover:text-teal-600">Book Session</a>
          <a href="#" className="text-gray-700 hover:text-teal-600">Contact</a>
        </nav>
      </header>
    </div>
  );
}

export default App;
